* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif; background: white; }

main { max-width: 1200px; margin: 0 auto; padding: 4rem 1rem; }
main h1 { color: #333; margin-bottom: 2rem; text-align: center; }

/* Hero Content */
.hero-content { background: linear-gradient(135deg, #667eea 0%, #764ba2 100%); color: white; padding: 4rem 2rem; border-radius: 8px; margin-bottom: 3rem; text-align: center; }
.hero-content p { font-size: 1.2rem; max-width: 600px; margin: 0 auto; }

/* Footer */
footer { background: #2c3e50; color: white; }

.footer-content { max-width: 1200px; margin: 0 auto; padding: 3rem 1rem; }

/* Footer Grid */
.footer-grid { display: grid; grid-template-columns: repeat(auto-fit, minmax(200px, 1fr)); gap: 2rem; margin-bottom: 2rem; }

.footer-section h3 { margin-bottom: 1rem; font-size: 1.1rem; color: white; }

.footer-section ul { list-style: none; }
.footer-section li { margin-bottom: 0.75rem; }
.footer-section a { color: #ecf0f1; text-decoration: none; transition: color 0.3s; }
.footer-section a:hover { color: #3498db; }

/* Social Links */
.social-links { display: flex; gap: 1rem; margin-top: 1rem; }
.social-links a { display: inline-block; width: 40px; height: 40px; background: rgba(255,255,255,0.1); border-radius: 50%; text-align: center; line-height: 40px; transition: background 0.3s; }
.social-links a:hover { background: #3498db; }

/* Footer Bottom */
.footer-bottom { border-top: 1px solid rgba(255,255,255,0.1); padding-top: 2rem; display: flex; justify-content: space-between; align-items: center; flex-wrap: wrap; gap: 1rem; }
.footer-bottom p { color: #bdc3c7; font-size: 0.9rem; }

/* Newsletter Signup */
.newsletter { background: rgba(52, 152, 219, 0.2); padding: 2rem; border-radius: 8px; margin-bottom: 2rem; }
.newsletter h3 { margin-bottom: 1rem; }
.newsletter-form { display: flex; gap: 0.5rem; flex-wrap: wrap; }
.newsletter-form input { flex: 1; min-width: 200px; padding: 0.75rem; border: none; border-radius: 4px; }
.newsletter-form button { padding: 0.75rem 1.5rem; background: #3498db; color: white; border: none; border-radius: 4px; cursor: pointer; font-weight: 500; }
.newsletter-form button:hover { background: #2980b9; }

@media (max-width: 768px) {
  .footer-grid { grid-template-columns: 1fr; }
  .footer-bottom { flex-direction: column; text-align: center; }
}
